import React from 'react';
import { Link } from 'react-router-dom';
import './MenuList.css';

class MenuList extends React.Component {
  render() {
    return(
      <div className={this.props.className}>
        <Link to="/" onClick={this.props.onClick}>Home</Link>
        <Link to="/login" onClick={this.props.onClick}>Login</Link>
        <Link to="/register" onClick={this.props.onClick}>Register</Link>
        <Link to="/about" onClick={this.props.onClick}>About</Link>
        <Link to="/partners" onClick={this.props.onClick}>Partners</Link>
      </div>
    )
  }
}

export default MenuList;
